  summary: "\n <code>StreamingRecognizeResponse</code> is the only message returned to the client by\n <code>StreamingRecognize</code>. A series of zero or more <code>StreamingRecognizeResponse</code>\n messages are streamed back to the client. If there is no recognizable\n audio, and <code>single_utterance</code> is set to false, then no messages are streamed\n back to the client.\n Here's an example of a series of <code>StreamingRecognizeResponse</code>s that might be\n returned while processing audio:\n 1. results { alternatives { transcript: \"tube\" } stability: 0.01 }\n 2. results { alternatives { transcript: \"to be a\" } stability: 0.01 }\n 3. results { alternatives { transcript: \"to be\" } stability: 0.9 }\n    results { alternatives { transcript: \" or not to be\" } stability: 0.01 }\n 4. results { alternatives { transcript: \"to be or not to be\"\n                             confidence: 0.92 }\n              alternatives { transcript: \"to bee or not to bee\" }\n              is_final: true }\n 5. results { alternatives { transcript: \" that's\" } stability: 0.01 }\n 6. results { alternatives { transcript: \" that is\" } stability: 0.9 }\n    results { alternatives { transcript: \" the question\" } stability: 0.01 }\n 7. results { alternatives { transcript: \" that is the question\"\n                             confidence: 0.98 }\n              alternatives { transcript: \" that was the question\" }\n              is_final: true }\n Notes:\n - Only two of the above responses #4 and #7 contain final results; they are\n   indicated by <code>is_final: true</code>. Concatenating these together generates the\n   full transcript: \"to be or not to be that is the question\".\n - The others contain interim <code>results</code>. #3 and #6 contain two interim\n   <code>results</code>: the first portion has a high stability and is less likely to\n   change; the second portion has a low stability and is very likely to\n   change. A UI designer might choose to show only high stability <code>results</code>.\n - The specific <code>stability</code> and <code>confidence</code> values shown above are only for\n   illustrative purposes. Actual values may vary.\n - In each response, only one of these fields will be set:\n     <code>error</code>,\n     <code>speech_event_type</code>, or\n     one or more (repeated) <code>results</code>.\n \n\n Protobuf type <code>google.cloud.speech.v1p1beta1.StreamingRecognizeResponse</code>"
